import styled from "styled-components";
import { motion } from "framer-motion";

const NavbarFewerColosStyle = styled(motion.div)`
  position: absolute;
  right: 1vw;
  width: 400px;
  background-color: #f8f8ff;
  height: auto;
  padding: 20px;
  cursor: auto;
  display: flex;
  justify-content: space-between;
  display: none;
  .section {
    display: flex;
    flex-direction: column;
    height: 350px;
    width: 150px;
    * {
      cursor: auto;
    }
    .cover {
      position: absolute;
      background-color: darkviolet;
      height: 100px;
      width: 150px;
    }
    .title {
      color: #679267;
      margin-top: 120px;
      margin-bottom: 10px;
    }
    span {
      color: #1f1f1f;
    }
  }
`;
const NavbarFewerColos = () => {
  return (
    <NavbarFewerColosStyle>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> App Name </span>
        <span>Tresom</span>
        <span>Hatity</span>
        <span>Otcom</span>
        <span>Daltfresh</span>
        <span>Duobam</span>
        <span>Mat Lam Tam</span>
      </div>
    </NavbarFewerColosStyle>
  );
};
export default NavbarFewerColos;
